    <section class="about1">
        <div class="container" style="padding-top:80px; padding-bottom:80px;">
            <div class="panel with-nav-tabs ">
                <div class="">
            <ul class="nav nav-tabs">
                        <li class="active col-sm-4 m1"><a href="#tab1primary" data-toggle="tab" style="background-image:url(data:image/jpeg;base64,)">What we do</a></li>
                        <li class="col-sm-4 m1"><a href="#tab2primary" data-toggle="tab">Why are we different</a></li>
                        <li class="col-sm-4 m1"><a href="#tab3primary" data-toggle="tab">Why choose us</a></li>

                    </ul>
                </div>
                <div class="panel-body">
                    <div class="tab-content">
                        <div class="active fade in tab-pane" id="tab1primary">
                            <div class="col-sm-4"><img class="img-responsive" src="assets/images/work.jpg" /></div>

                            <div class="abt col-sm-8">
                                <h1>What Do We Do</h1>
                                &nbsp;

                                <p>PhosN&#39;s Gym has been the authority in fitness since 1965 dating back to the original Gold&#39;s Gym in Venice, California. It was the place for serious fitness. Opened long before the modern day health club existed, the original Gold&#39;s Gym featured homemade equipment and a dedication to getting results. It was an instant hit. Gold&#39;s Gym quickly became known as &ldquo;The Mecca of Bodybuilding.&#39;&#39;</p>

                                <p>In 1977, PhosN&#39;s Gym received international attention when it was featured in the movie Pumping Iron that starred Arnold Schwarzenegger and Lou Ferrigno. From that first gym in Venice, PhosN&#39;s Gym has become the largest co-ed gym chain in the world with over 700+ clubs in 28 countries. Today, Gold&#39;s Gym has expanded its fitness profile to offer all of the latest equipment and services, including group exercise, personal training, cardiovascular equipment, spinning and yoga, while maintaining its core weight lifting tradition.</p>

                                <p>PhosN&#39;s Gym has become the preferred gym of celebrities, athletes, bodybuilders, the military and fitness enthusiasts all over the world. Most importantly, PhosN&#39;s Gym continues to change lives by helping people achieve their individual potential.</p>

                                <p>The year 2019 marked the 17th Anniversary of PhosN&#39;s Gym India. In these glorious 17 years PhosN&rsquo;s Gym has cut out for itself 150 gyms in India across 95+ cities and a few more ready to start in the near future.</p>
                            </div>
                        </div>
                        <div class="fade tab-pane" id="tab2primary">
                            <div class="col-sm-4"><img class="img-responsive" src="assets/images/work.jpg" /></div>

                            <div class="abt col-sm-8">
                                <p>PhosN&rsquo;s Gym has multiple awards for excellence under its belt. Phosn&rsquo;s Gym has expanded its fitness profile to offer all of the latest equipment and services making it the best in the industry. Phosn&#39;s Gym provides a comprehensive approach to the health and wellbeing of its members with certified trainers and nutritional counseling. Whether your goal is to burn fat, tone or add muscle, build strength, increase flexibility or improve your cardiovascular health, Gold&rsquo;s Gym lives up to its reputation to give results. Gold&#39;s Gym believes that fitness is not just about a toned body but the power to overcome all the obstacles.</p>

                                <p>We have programs like Personal Training, Small Group Personal Training, Customized Goal Based Quick Result Program, Fitness Assessment, Group Exercise Classes such as Zumba, BollySalsa, MMA, Power Yoga, Spinning to name a few &amp; some of our properties also include a swimming pool facility and specialized functional &amp; circuit training areas. We also have as add on a Travel Card facility, so that wherever you are, your workout never stops.</p>
                            </div>
                        </div>

                        <p>&nbsp;</p>
                        <div class="fade tab-pane" id="tab3primary">
                            <div class="col-sm-4"><img class="img-responsive" src="assets/images/work.jpg" /></div>

                            <div class="abt col-sm-8">
                                <p>Known for the unrivalled success of providing state-of-the-art equipment and fitness knowledge with a globally proven fitness training module and with certified trainers and nutritional counselling we have had a comprehensive approach to the overall health and wellbeing of the members. At PhosN&rsquo;s Gym it&rsquo;s not only about working out but having a healthy lifestyle</p>

                                <p>We have also been doing a lot of Corporate &amp; Community Wellness Programs, reaching out to people who want to get fitter but cannot make it to the gym. We have focused on the overall experience. It is not just about getting into a particular shape but it&rsquo;s all about FITNESS, a healthy lifestyle and, a complete transformation.</p>

                                <p>We feel proud and glad to say that with the support of Phosn&rsquo;s Gym International, Our Members, Employees, Vendor Partners &amp; Franchisee Partners the brand has grown leaps and bounds and has been able to contribute to the betterment of the nation. We are working towards #MakingIndiaFit and we are hopeful of spreading fitness awareness to as many people as possible</p>
                            </div>
                        </div>




                    </div>
                </div>
            </div>
        </div>
    </section>



